const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>Pinpoint Personal Plates</h1>
            <div className="links">
                <a href="/search">Search Plates</a>
                <a href="/create">Create a Plate</a>
            </div>
        </nav>
    );
};

export default Navbar;
